import React, { useState, useRef, useEffect } from 'react';
import { createRoot } from 'react-dom/client';
import { GoogleGenAI, Type } from '@google/genai';

// --- Types ---
type AppMode = 'chat' | 'vision' | 'image-gen' | 'settings';

interface Message {
  role: 'user' | 'assistant';
  content: string;
  image?: string;
  isImageResult?: boolean;
}

// --- Components ---

const LuminaApp = () => {
  const [mode, setMode] = useState<AppMode>('chat');
  const [messages, setMessages] = useState<Message[]>([
    { role: 'assistant', content: "Welcome to Lumina AI. How can I assist you today?" }
  ]);
  const [inputText, setInputText] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [selectedImage, setSelectedImage] = useState<string | null>(null);
  const chatEndRef = useRef<HTMLDivElement>(null);

  const scrollToBottom = () => {
    chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const handleSendMessage = async () => {
    if (!inputText.trim() && !selectedImage) return;

    const userMessage: Message = {
      role: 'user',
      content: inputText,
      image: selectedImage || undefined
    };

    setMessages(prev => [...prev, userMessage]);
    setInputText('');
    setIsLoading(true);

    try {
      const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });

      if (mode === 'image-gen') {
        const response = await ai.models.generateContent({
          model: 'gemini-2.5-flash-image',
          contents: { parts: [{ text: inputText }] },
          config: { imageConfig: { aspectRatio: "1:1" } }
        });

        let imageUrl = '';
        for (const part of response.candidates[0].content.parts) {
          if (part.inlineData) {
            imageUrl = `data:${part.inlineData.mimeType};base64,${part.inlineData.data}`;
            break;
          }
        }

        setMessages(prev => [...prev, {
          role: 'assistant',
          content: imageUrl ? 'Generated your image:' : 'Failed to generate image.',
          image: imageUrl,
          isImageResult: true
        }]);
      } else {
        const modelName = mode === 'vision' ? 'gemini-3-flash-preview' : 'gemini-3-pro-preview';

        let contents: any;
        if (selectedImage) {
          const base64Data = selectedImage.split(',')[1];
          const mimeType = selectedImage.split(',')[0].split(':')[1].split(';')[0];
          contents = {
            parts: [
              { inlineData: { data: base64Data, mimeType } },
              { text: inputText || "What is in this image?" }
            ]
          };
        } else {
          contents = inputText;
        }

        const response = await ai.models.generateContent({
          model: modelName,
          contents,
          config: {
            systemInstruction: "You are Lumina AI, a helpful and sophisticated AI assistant. You provide clear, concise, and professional responses."
          }
        });

        setMessages(prev => [...prev, {
          role: 'assistant',
          content: response.text || "I couldn't generate a response."
        }]);
      }
    } catch (error) {
      console.error(error);
      setMessages(prev => [...prev, {
        role: 'assistant',
        content: "An error occurred while connecting to the AI service. Please try again."
      }]);
    } finally {
      setIsLoading(false);
      setSelectedImage(null);
    }
  };

  const handleImageUpload = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setSelectedImage(reader.result as string);
        setMode('vision');
      };
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="flex h-screen w-full overflow-hidden">
      {/* Sidebar */}
      <aside className="w-20 md:w-64 glass border-r flex flex-col items-center md:items-stretch py-6 px-4 space-y-8 transition-all">
        <div className="flex items-center space-x-3 px-2">
          <div className="w-10 h-10 bg-indigo-600 rounded-xl flex items-center justify-center shadow-lg shadow-indigo-500/20">
            <i data-lucide="zap" className="text-white w-6 h-6"></i>
          </div>
          <span className="hidden md:block text-xl font-bold tracking-tight text-indigo-100">Lumina AI</span>
        </div>

        <nav className="flex-1 space-y-2">
          <SidebarItem 
            icon="message-square" 
            label="Omni Chat" 
            active={mode === 'chat'} 
            onClick={() => setMode('chat')} 
          />
          <SidebarItem 
            icon="eye" 
            label="Vision Hub" 
            active={mode === 'vision'} 
            onClick={() => setMode('vision')} 
          />
          <SidebarItem 
            icon="image" 
            label="Art Studio" 
            active={mode === 'image-gen'} 
            onClick={() => setMode('image-gen')} 
          />
        </nav>

        <div className="pt-6 border-t border-slate-700/50">
          <SidebarItem 
            icon="settings" 
            label="Settings" 
            active={mode === 'settings'} 
            onClick={() => setMode('settings')} 
          />
        </div>
      </aside>

      {/* Main Content Area */}
      <main className="flex-1 flex flex-col relative">
        {/* Header */}
        <header className="h-16 border-b border-slate-700/50 flex items-center justify-between px-8 glass z-10">
          <h2 className="text-sm font-medium text-slate-400 uppercase tracking-widest">
            {mode.replace('-', ' ')}
          </h2>
          <div className="flex items-center space-x-4">
             <span className="flex h-2 w-2 rounded-full bg-emerald-500 ring-4 ring-emerald-500/20"></span>
             <span className="text-xs text-emerald-500 font-medium">System Ready</span>
          </div>
        </header>

        {/* Chat Messages */}
        <div className="flex-1 overflow-y-auto p-4 md:p-8 space-y-6">
          {messages.map((msg, idx) => (
            <div key={idx} className={`flex ${msg.role === 'user' ? 'justify-end' : 'justify-start'}`}>
              <div className={`max-w-[85%] md:max-w-[70%] rounded-2xl p-4 shadow-sm ${
                msg.role === 'user' 
                ? 'bg-indigo-600 text-white rounded-tr-none' 
