              }`}>
                {msg.image && (
                  <img 
                    src={msg.image} 
                    alt="Uploaded/Generated" 
                    className="max-w-full rounded-lg mb-3 border border-white/10 shadow-lg"
                  />
                )}
                <div className="whitespace-pre-wrap leading-relaxed text-sm md:text-base">
                  {msg.content}
                </div>
              </div>
            </div>
          ))}
          {isLoading && (
            <div className="flex justify-start">
              <div className="glass rounded-2xl p-4 rounded-tl-none animate-pulse flex space-x-2">
                <div className="w-2 h-2 bg-slate-500 rounded-full animate-bounce"></div>
                <div className="w-2 h-2 bg-slate-500 rounded-full animate-bounce delay-75"></div>
                <div className="w-2 h-2 bg-slate-500 rounded-full animate-bounce delay-150"></div>
              </div>
            </div>
          )}
          <div ref={chatEndRef} />
        </div>

        {/* Input Area */}
        <div className="p-4 md:p-8 bg-gradient-to-t from-slate-950 via-slate-950 to-transparent">
          <div className="max-w-4xl mx-auto relative group">
            {selectedImage && (
              <div className="absolute bottom-full mb-4 left-0 glass p-2 rounded-xl flex items-center space-x-2 animate-in fade-in slide-in-from-bottom-2">
                <img src={selectedImage} className="w-12 h-12 object-cover rounded-md" />
                <button 
                  onClick={() => setSelectedImage(null)}
                  className="p-1 hover:bg-red-500/20 rounded-full text-red-400 transition-colors"
                >
                  <i data-lucide="x" className="w-4 h-4"></i>
                </button>
              </div>
