            <div className="relative flex items-end glass rounded-2xl border-slate-700/50 overflow-hidden focus-within:border-indigo-500/50 transition-all shadow-2xl">
              <label className="p-4 cursor-pointer hover:bg-slate-800/50 transition-colors text-slate-400 hover:text-indigo-400">
                <i data-lucide="paperclip" className="w-5 h-5"></i>
                <input type="file" className="hidden" accept="image/*" onChange={handleImageUpload} />
              </label>

              <textarea
                value={inputText}
                onChange={(e) => setInputText(e.target.value)}
                onKeyDown={(e) => {
