                <div className="flex items-center gap-2 mb-3">
                   <div className={`w-5 h-5 rounded-sm flex items-center justify-center ${m.role === 'user' ? 'bg-indigo-500' : 'bg-slate-700'}`}>
                      <i data-lucide={m.role === 'user' ? 'user' : 'cpu'} className="w-3 h-3 text-white"></i>
                   </div>
                   <span className="text-[10px] font-mono uppercase text-slate-500 tracking-widest">{m.role === 'user' ? 'Client' : 'System'}</span>
                </div>
                {m.image && <img src={m.image} className="w-full rounded mb-4 zen-border shadow-xl" alt="AI Generated" />}
                <div className="text-sm md:text-base leading-relaxed whitespace-pre-wrap font-medium text-slate-200">
                  {m.content}
                </div>
                {m.links && (
                  <div className="mt-4 pt-4 border-t border-slate-800 flex flex-wrap gap-2">
                    {m.links.map((link, li) => (
                      <a key={li} href={link.uri} target="_blank" rel="noopener noreferrer" className="text-[10px] bg-slate-800 hover:bg-slate-700 px-2 py-1 rounded flex items-center gap-1 transition-colors">
                        <i data-lucide="external-link" className="w-3 h-3"></i>
                        {link.title}
                      </a>
                    ))}
                  </div>
                )}
              </div>
            </div>
          ))}
          {isLoading && (
            <div className="flex justify-start">
               <div className="bg-slate-900 zen-border p-4 rounded-lg flex items-center gap-3">
                  <div className="w-1.5 h-1.5 bg-indigo-500 rounded-full animate-bounce"></div>
                  <div className="w-1.5 h-1.5 bg-indigo-500 rounded-full animate-bounce [animation-delay:-.3s]"></div>
                  <div className="w-1.5 h-1.5 bg-indigo-500 rounded-full animate-bounce [animation-delay:-.5s]"></div>
                  <span className="text-[10px] font-mono text-slate-500 uppercase tracking-widest">Processing</span>
               </div>
            </div>
          )}
          <div ref={chatEndRef} />
        </div>

        {/* Interface Controls */}
        <div className="p-4 md:p-10 border-t border-slate-800/50 bg-slate-950">
          <div className="max-w-4xl mx-auto">
            {mode === 'live' ? (
              <div className="flex flex-col items-center justify-center p-12 zen-border bg-slate-900/50 rounded-2xl">
                 <div className={`w-24 h-24 rounded-full flex items-center justify-center mb-6 transition-all duration-500 ${isLiveActive ? 'bg-red-500/20 scale-110 active-glow' : 'bg-slate-800'}`}>
                    <i data-lucide={isLiveActive ? "mic" : "mic-off"} className={`w-10 h-10 ${isLiveActive ? 'text-red-400' : 'text-slate-500'}`}></i>
                 </div>
                 <h3 className="text-xl font-bold mb-2 uppercase tracking-tighter italic">Voice Interaction Layer</h3>
                 <p className="text-slate-500 text-sm mb-8 text-center max-w-xs">Real-time low-latency audio connection with Zenith Native Audio Module.</p>
                 <button 
                  onClick={isLiveActive ? stopLiveSession : startLiveSession}
                  className={`px-8 py-3 rounded-full font-bold transition-all ${isLiveActive ? 'bg-red-600 hover:bg-red-500 text-white' : 'bg-indigo-600 hover:bg-indigo-500 text-white'}`}
                 >
                   {isLiveActive ? "Disconnect Session" : "Establish Audio Link"}
                 </button>
              </div>
            ) : (
              <div className="relative group">
                {selectedImage && (
                  <div className="absolute bottom-full mb-4 left-0 p-2 bg-slate-900 zen-border rounded-lg flex items-center gap-3 animate-in fade-in slide-in-from-bottom-2">
                    <img src={selectedImage} className="w-12 h-12 object-cover rounded" />
                    <button onClick={() => setSelectedImage(null)} className="p-1 hover:bg-red-500/20 rounded-full text-red-400">
                      <i data-lucide="x" className="w-4 h-4"></i>
                    </button>
                  </div>
                )}
                <div className="flex items-end bg-slate-900 zen-border rounded-xl p-2 focus-within:border-indigo-500/50 transition-all shadow-2xl">
                   <label className="p-3 cursor-pointer hover:bg-slate-800 rounded-lg text-slate-500 transition-colors">
                      <i data-lucide="image-plus" className="w-5 h-5"></i>
                      <input type="file" className="hidden" accept="image/*" onChange={onFileSelect} />
                   </label>
                   <textarea 
                    value={inputText}
                    onChange={(e) => setInputText(e.target.value)}
                    onKeyDown={(e) => { if (e.key === 'Enter' && !e.shiftKey) { e.preventDefault(); handleSend(); }}}
                    placeholder={mode === 'studio' ? "Describe asset to render..." : "Execute command or query..."}
                    className="flex-1 bg-transparent border-none focus:ring-0 py-3 px-4 resize-none max-h-48 text-sm md:text-base font-medium placeholder-slate-600"
                    rows={1}
                   />
                   <button 
                    onClick={handleSend}
                    disabled={isLoading || (!inputText.trim() && !selectedImage)}
                    className="p-3 bg-indigo-600 hover:bg-indigo-500 disabled:bg-slate-800 disabled:text-slate-600 rounded-lg transition-all"
                   >
                     <i data-lucide="chevron-right" className="w-5 h-5"></i>
                   </button>
                </div>
              </div>
            )}
          </div>
        </div>
      </main>
    </div>
  );
};

const NavItem = ({ icon, label, active, onClick }: { icon: string; label: string; active: boolean; onClick: () => void }) => (
  <button 
    onClick={onClick}
    className={`w-full flex items-center gap-3 p-3 rounded-lg transition-all group ${active ? 'bg-indigo-600 text-white shadow-lg' : 'text-slate-500 hover:text-slate-300 hover:bg-slate-800/50'}`}
  >
    <i data-lucide={icon} className={`w-5 h-5 ${active ? 'text-white' : 'group-hover:scale-110 transition-transform'}`}></i>
    <span className="hidden md:block text-sm font-bold uppercase tracking-widest">{label}</span>
  </button>
);

// Start App
const root = createRoot(document.getElementById('root')!);
root.render(<ZenithApp />);

