Here are the specific code snippets used for the assessment form and the AI analysis logic in your **HyzaLabs** application.

### 1. The Strategic Analysis Prompt
This is the "brain" of the form. It instructs the Gemini model on how to behave, what tone to use, and how to structure the data.

**File:** `services/geminiService.ts`
```typescript
const prompt = `Analyze the following operational bottlenecks for a fitness business/gym and provide a professional, calm, strategic 3-point insight report.

Business Context:
- Name: ${data.fullName}
- Monthly Budget Range: ${data.budget}
- Reported Bottlenecks: ${data.bottlenecks}

Instructions:
- Do not use hype.
- Be intelligent and strategic.
- Suggest how custom AI/automation (not specific software) might solve these.
- Keep it brief (3 clear points).`;
```

---

### 2. The API Integration (Gemini Service)
This code handles the communication between your website and the Google AI. It uses a **JSON Schema** to ensure the AI always returns valid data that the website can display.

**File:** `services/geminiService.ts`
```typescript
import { GoogleGenAI, Type } from "@google/genai";

export const analyzeBottlenecks = async (data: LeadFormData) => {
  const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });

  const response = await ai.models.generateContent({
    model: "gemini-3-flash-preview",
    contents: prompt, // Using the prompt defined above
    config: {
      responseMimeType: "application/json",
      responseSchema: {
        type: Type.OBJECT,
        properties: {
          strategicInsights: {
            type: Type.ARRAY,
            items: { type: Type.STRING },
          },
          recommendedFocus: {
            type: Type.STRING,
          }
        },
        required: ["strategicInsights", "recommendedFocus"]
      }
    }
  });

  return JSON.parse(response.text);
};
```

---

### 3. The Form Component (JSX)
This is the UI code (Tailwind CSS + React) used to build the input fields and handle the loading state.

**File:** `App.tsx` (Inside the main component)
```tsx
<form onSubmit={handleSubmit} className="space-y-6">
  <div className="grid md:grid-cols-2 gap-6">
    <div className="space-y-2">
      <label className="text-xs font-semibold uppercase text-white/40 tracking-wider">Full Name</label>
      <input 
        type="text" 
        required
        placeholder="e.g. Alex Rivera"
        className="w-full bg-black/50 border border-white/10 rounded-lg px-4 py-3 text-sm focus:border-indigo-500 transition-all outline-none"
        value={formData.fullName}
        onChange={e => setFormData({...formData, fullName: e.target.value})}
      />
    </div>
    {/* ... other fields follow same pattern ... */}
  </div>

  <div className="space-y-2">
    <label className="text-xs font-semibold uppercase text-white/40 tracking-wider">Main Business Bottlenecks</label>
    <textarea 
      rows={4}
      required
      placeholder="Where is your team spending most of their manual time?"
      className="w-full bg-black/50 border border-white/10 rounded-lg px-4 py-3 text-sm focus:border-indigo-500 transition-all outline-none resize-none"
      value={formData.bottlenecks}
      onChange={e => setFormData({...formData, bottlenecks: e.target.value})}
    />
  </div>

  <button 
    type="submit" 
    disabled={isSubmitting}
    className="w-full py-4 bg-indigo-600 hover:bg-indigo-500 text-white font-bold rounded-lg transition-all disabled:opacity-50"
  >
    {isSubmitting ? "Engine Analyzing..." : "Generate Neural Insight Report"}
  </button>
</form>
```

---

### 4. Handling the Submission Logic
This React function bridges the form and the service. It triggers the loading animation and stores the AI's response in the `analysis` state.

**File:** `App.tsx`
```typescript
const [formData, setFormData] = useState<LeadFormData>({
  fullName: '',
  email: '',
  phone: '',
  budget: '',
  bottlenecks: ''
});

const handleSubmit = async (e: React.FormEvent) => {
  e.preventDefault();
  setIsSubmitting(true);

  // Calls the Gemini Service
  const result = await analyzeBottlenecks(formData);

  // Updates the UI with the AI report
  setAnalysis(result);
  setIsSubmitting(false);
};

