import BackgroundParticles from './components/BackgroundParticles.tsx';
import { analyzeBottlenecks } from './services/geminiService.ts';
import { LeadFormData, AnalysisResponse } from './types.ts';

declare global {
  interface Window {
    Calendly: any;
  }
}

const App: React.FC = () => {
  const [formData, setFormData] = useState<LeadFormData>({
    fullName: '',
    email: '',
    phone: '',
    budget: '',
    bottlenecks: ''
  });
  const [analysis, setAnalysis] = useState<AnalysisResponse | null>(null);
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [isBooked, setIsBooked] = useState(false);

  // The 15-minute event URL as specified
  const BASE_CALENDLY_URL = 'https://calendly.com/marton-hyzalabs/15min';

  const triggerCalendly = () => {
    const safeEncode = (str: string) => encodeURIComponent(str.trim()).replace(/\+/g, '%20');

    const nameVal = safeEncode(formData.fullName);
    const emailVal = safeEncode(formData.email);
    const phoneVal = safeEncode(formData.phone);
    const bottlenecksVal = safeEncode(formData.bottlenecks);

    const queryString = `name=${nameVal}&email=${emailVal}&phone_number=${phoneVal}&a1=${bottlenecksVal}`;
    const finalUrl = `${BASE_CALENDLY_URL}?${queryString}`;

    if (window.Calendly) {
      window.Calendly.showPopupWidget(finalUrl);
      setIsBooked(true);
    } else {
      window.open(finalUrl, '_blank');
      setIsBooked(true);
    }
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setIsSubmitting(true);

    try {
      const result = await analyzeBottlenecks(formData);
      setAnalysis(result);
      setIsSubmitting(false);

      setTimeout(() => {
        triggerCalendly();
      }, 1000);
    } catch (error) {
      console.error("Submission error", error);
      setIsSubmitting(false);
    }
  };

  const scrollToSection = (e: React.MouseEvent<HTMLAnchorElement>, id: string) => {
    e.preventDefault();
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="min-h-screen bg-black text-white selection:bg-indigo-500/30 overflow-hidden font-inter relative">
      <BackgroundParticles />

      {/* Background Atmosphere - Enhanced for Neural Theme */}
      <div className="fixed top-0 left-0 w-full h-full pointer-events-none -z-20">
        <div 
          className="absolute top-[-20%] left-[-10%] w-[70%] h-[70%] bg-indigo-900/5 rounded-full blur-[160px] animate-pulse" 
          style={{ animationDuration: '20s' }} 
        />
        <div 
          className="absolute bottom-[-10%] right-[-10%] w-[60%] h-[60%] bg-purple-900/5 rounded-full blur-[140px] animate-pulse" 
          style={{ animationDuration: '25s', animationDelay: '5s' }} 
        />
        {/* Subtle scanline effect */}
        <div className="absolute inset-0 bg-[linear-gradient(rgba(18,16,16,0)_50%,rgba(0,0,0,0.25)_50%),linear-gradient(90deg,rgba(255,0,0,0.01),rgba(0,255,0,0.01),rgba(0,0,255,0.01))] bg-[length:100%_4px,3px_100%] opacity-20 pointer-events-none" />
      </div>

      {/* Header */}
      <header className="fixed top-0 w-full z-50 border-b border-white/5 bg-black/40 backdrop-blur-xl">
        <div className="max-w-7xl mx-auto px-6 h-20 flex items-center justify-between">
          <div className="flex items-center gap-3">
            <NeuralBrain className="w-8 h-8" />
            <span className="text-xl font-bold tracking-tighter">HyzaLabs</span>
          </div>
          <nav className="hidden md:flex items-center gap-8 text-xs font-semibold uppercase tracking-widest text-white/40">
