    const safeEncode = (str: string) => encodeURIComponent(str.trim()).replace(/\+/g, '%20');
    const queryString = `name=${safeEncode(formData.fullName)}&email=${safeEncode(formData.email)}&phone_number=${safeEncode(formData.phone)}&a1=${safeEncode(formData.bottlenecks)}`;
    const finalUrl = `${BASE_CALENDLY_URL}?${queryString}`;

